import React, { useState } from "react";
import Card from '../Ui/Card'


export default function Userlist(props) {


return(
    <Card>
      <ul>
        {props.userslist.map((user) => {
          <li>
              {user.name} ({user.age} Years Old)

          </li>;
        })}
      </ul>
      </Card>
      )


}
